import React from "react";
// import { useNavigate } from "react-router-dom";

const MainStage = ({ stage }) => {
  return (
    <div>
      <p>Main Stage</p>
      <button
        onClick={(e) => {
          e.preventDefault();
          stage = "project";
        }}
      >
        Project
      </button>
    </div>
  );
};

const ProjectStage = ({ stage }) => {
  return (
    <div>
      <p>Project Stage</p>
      <button
        onClick={(e) => {
          e.preventDefault();
          stage = "project";
        }}
      >
        Back
      </button>
    </div>
  );
};

const NavBar = ({}) => {
  return (
    <div>
      <button type="button" onClick={(e) => handleLogout(e)}>
        Log Out
      </button>
      <button type="button" onClick={(e) => handleProfile(e)}>
        Profile
      </button>
    </div>
  );
};

export default NavBar;
